const Home = ({name, paragraph, authorImage})=>{

    return(
    <div>
        <div className="home_container">
            <div className="home_head_wrapper">
            < h1 > Michael<br></br> <span>David Gragg</span></h1>
            <p>{paragraph}</p>
            </div>
            <div className="image_container">
                <div className="bg"></div>
            </div>

        </div>
    </div>
    )
}

export default Home;
